import React from "react";
// styled component
import * as S from "./custom-button.styles";

const CustomButton = ({ children, ...props }) => {
  return (
    <S.CustomButtonContainer {...props}>{children}</S.CustomButtonContainer>
  );
};

export default CustomButton;
